import { Box, Button, Icon, Input, Text } from "components";
import React from "react";
import { LoginForm } from "screens/components";

export const Login = () => {
  const handleClick = () => console.log("Button Clicked");
  return (
    <Box
      // horizontalArrangement="space-between"
      fullHeight
      // verticalArrangement="space-between"
      style={{ backgroundColor: "lightblue" }}>

      <Text variant={"body"}>simple</Text>
      <Text variant="h1">Login</Text>
      <Text variant="h2">simple</Text>
      <Text variant="h3">simple</Text>
      <div>
        <Button label="Click Me" onClick={handleClick} />
        <Button label="Loading Button" isLoading />
        <Button label="Disabled Button" disabled />
        <Button
          label="Button with Icons"
          leftIcon={<Icon name="user" />}
          rightIcon={<Icon name="user" />}
          onClick={handleClick}
        />
        <Button icon={<Icon name="user" />} />
      </div>
      <Input />

      <LoginForm />
    </Box>
  );
};
